import React from "react";
import { useMotionValue, useTransform, motion } from 'frame-mation';

const Card = () => {
    const x = useMotionValue(0);
    const y = useMotionValue(0);
    const rotateX = useTransform(y, [-100, 100], [30, -30]);
    const rotateY = useTransform(x, [-100, 100], [-30, 30]);

    return (
        <div className="absolute top-[140px] left-[550px] fixed">
            <motion.div 
            style={{x, y, rotateX, rotateY, z: 100}}  
            drag
            className="w-[426px] min-h-[600px] text-center justify-center bg-white">
                <p className="">Fuck Up</p>
            </motion.div>
        </div>
    )
}

export default Card;
